import React from 'react';
import TodoItem from './TodoItem';

export default function TodoContainer({todos}) {
    //^^destructures the key of todos from props

    const showTodos = () => {
        return todos.map(todo => <TodoItem key={todo.id}{...todo} />)
    }

    return (
        <ul>
            TodoContainer
        </ul>
    )
}
